import Affichage from "./Affiche";
export default function Tout4(props){
    return (
        props.recipes.filter(function(rec){
            return(
                rec.name==='Classic Margherita Pizza'
            )
        }).map(function(rec,i){
            return(
                <Affichage recipes={rec} key= {i} />
            )
        })
    )
}
